// Extract fields and prepare rows
let rows = items.map(item => {
    const fields = item.json.fields;

    let row = {};
    for (let key in fields) {
        // Flatten arrays to comma-separated strings
        if (Array.isArray(fields[key])) {
            row[key] = fields[key].join(", ");
        } else {
            row[key] = fields[key];
        }
    }
    return { json: row };
});

// Sort by ProductID ascending (numeric or string)
rows.sort((a, b) => {
    // If ProductID is numeric, convert to number, otherwise string compare
    let idA = isNaN(Number(a.json.ProductID)) ? a.json.ProductID : Number(a.json.ProductID);
    let idB = isNaN(Number(b.json.ProductID)) ? b.json.ProductID : Number(b.json.ProductID);
    return idA > idB ? 1 : idA < idB ? -1 : 0;
});

return rows;
